(56, '3195', '8', 'Text Entry', '', '', '', '2006', '2', '<p>Following transactions are given:</p>\n<ol>\n<li>Started business with cash Rs. 250,000</li>\n<li>Goods purchaed on credit of Rs. 40,000</li>\n<li>Goods costing Rs. 20,000 was sold for cash for Rs. 25,000</li>\n<li>Paid to creditors Rs. 10,000</li>\n</ol>\n<p><strong>Required</strong>: Accounting equation</p>', 9, 12, 19, 0, 1, 0, 0, 21, 92, 0, 0, 143, 1, '2016-05-15 15:15:30'),
(57, '74521', '8', 'Text Entry', '0', '0', '0', '2063', '2', '<p>Following transactions are given:</p>\n<ol>\n<li>Started business with cash Rs. 1,00,000 Bank Rs. 3,00,000 and furniture Rs. 50,000</li>\n<li>Purchased goods worth Rs. 1,00,000 from A &amp; B suppliers.</li>\n<li>Sold goods worth Rs. 50,000 in cash</li>\n<li>Paid wages Rs. 12,000 Rs. 10,000 by cheque &amp; Rs. 2,000 by cash.</li>\n</ol>\n<p><strong>Required</strong>: Accounting equation</p>', 9, 12, 19, 0, 1, 0, 0, 21, 93, 0, 0, 48, 1, '2016-05-24 15:01:11'),
(58, '6353', '8', 'Text Entry', '', '', '', '2006', '2', '<p>Following transactions are given:</p>\n<ol>\n<li>Started business with bank balance of Rs. 3,00,000</li>\n<li>Goods purchased on credit Rs. 50,000</li>\n<li>Goods sold for cash Rs. 40,000</li>\n<li>Commision received in advance Rs. 10,000</li>\n</ol>\n<p><strong>Required</strong>: Accounting equation</p>', 9, 12, 19, 0, 1, 0, 0, 21, 93, 0, 0, 143, 1, '2016-05-15 15:15:30'),
(59, '73757', '8', 'Text Entry', '', '', '', '2006', '2', '<p>Following transactions are given</p>\n<ol>\n<li>Started business with cash Rs. 2,00,000</li>\n<li>Purchased goods for cash Rs. 50,000 and on credit Rs. 40,000</li>\n<li>Paid salary Rs. 20,000</li>\n<li>Goods costing Rs. 30,000 was sold for Rs. 40,000</li>\n</ol>\n<p><strong>Required</strong>: Accountign equation</p>', 9, 12, 19, 0, 1, 0, 0, 21, 93, 0, 0, 143, 1, '2016-05-15 15:15:30'),
(60, '81949', '8', 'Text Entry', '', 'practical', '', '2006', '2', '<p>Following transactions are given:</p>\n<ol>\n<li>Started business depositing Rs. 1,00,000 into bank</li>\n<li>Paid wages Rs. 10,000</li>\n<li>Purchased goods on credit Rs. 5,000</li>\n<li>Received house rent Rs. 2,000</li>\n</ol>\n<p><strong>Required</strong>: Accounting equation</p>', 9, 12, 19, 0, 1, 0, 0, 21, 93, 0, 0, 143, 1, '2016-05-15 15:15:30'),
(61, '9588', '8', 'Text Entry', '', 'practical', '', '2006', '2', '<p>Following transactions are given:</p>\n<ol>\n<li>Started business with cash Rs. 1,00,000 and stock Rs. 50,000</li>\n<li>Goods sold on credit Rs. 10,000</li>\n<li>Paid salary Rs. 5,000</li>\n<li>Goods purchased on credit Rs. 20,000</li>\n</ol>\n<p><strong>Required</strong>: Accounting equation</p>', 9, 12, 19, 0, 1, 0, 0, 21, 93, 0, 0, 143, 1, '2016-05-15 15:15:30'),
(62, '67647', '8', 'Text Entry', '', 'practical', '', '2006', '2', '<p>The following transactgions are given:</p>\n<p>a.Commenced business with cash Rs. 50,000 and furniture Rs. 30,00</p>\n<p>b.Purchased goods for cash Rs. 20,000</p>\n<p>c. Purchased goods on credit Rs. 30,000</p>\n<p>d.Settled credit pruchased account by paying cash Rs. 29,000.</p>\n<p><strong>Required</strong>: Accounting equation.</p>', 9, 12, 19, 0, 1, 0, 0, 21, 93, 0, 0, 143, 1, '2016-05-15 15:15:30'),
(63, '41696', '8', 'Text Entry', '', 'practical', 'bs', '2066', '2', '<p>The following transactions are given:</p>\n<p>(i)&nbsp;&nbsp;&nbsp; Gauri started business with cash Rs.2,00,000 and stock of Rs.50,000</p>\n<p>(ii)&nbsp;&nbsp; He purchased furniture for Rs.20,000</p>\n<p>(iii)&nbsp; He purchased goods on credit for Rs.20,000 from Krishna</p>\n<p>(iv)&nbsp; He sold goods costing Rs.15,000 for Rs.20,000 to Gopal.</p>\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Required:</strong> Accounting Equation</p>', 9, 12, 19, 0, 1, 0, 0, 21, 93, 0, 0, 143, 1, '2016-05-15 15:15:30'),
(64, '4427', '5', 'Text Entry', '', 'practical', 'bs', '2066', '2', '<p>The following transactions are given:</p>\n<ul>\n<li>Commencement of business with cash Rs. 1,00,000 and furniture Rs. 20,000</li>\n<li>Purchase goods of Rs. 20,000 for cash</li>\n<li>Sold goods costing Rs. 10,000 at Rs. 12,000</li>\n</ul>\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Required:</strong> Accounting Equation</p>', 9, 12, 19, 0, 1, 0, 0, 21, 93, 0, 0, 143, 1, '2016-05-15 15:15:30'),
(65, '73714', '8', 'Text Entry', '', 'practical', 'bs', '2065', '2', '<p>Following transactions are given:</p>\n<p>(a)&nbsp;&nbsp; Started business with bank balance of Rs.2,00,000</p>\n<p>(b)&nbsp;&nbsp; Purchased goods worth Rs.80,000 payment made by cheque</p>\n<p>(c)&nbsp;&nbsp; Paid salary of Rs.20,000 by cheque</p>\n<p>(d)&nbsp;&nbsp; Sold goods costing Rs.50,000 for Rs.70,000 cash.</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>Required:</strong> Accounting Equation</p>', 9, 12, 19, 0, 1, 0, 0, 21, 93, 0, 0, 143, 1, '2016-05-15 15:15:30'),
