(67, '37531', '9', 'Text Entry', 'C', 'practical', 'bs', '2070', '4', '<p>Following transactions are given:</p>\n<p>2069 Magh 1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; :&nbsp;&nbsp; Started business with cash Rs. 5,00,000</p>\n<p>2069 Magh 3&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; :&nbsp;&nbsp; Deposited into bank of Rs. 1,50,000</p>\n<p>2069 Magh 5&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; :&nbsp;&nbsp; Goods purchased from pradhan on credit of Rs. 50,000</p>\n<p>2069 Magh 7&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; :&nbsp;&nbsp; Goods sold to shrestha on credit of Rs. 25,000</p>\n<p>2069 Magh 12&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; :&nbsp;&nbsp; Pradhan''s account was settled by paying cash of Rs. 49,000</p>\n<p>2069 Magh 15&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; :&nbsp;&nbsp; Shrestha has settled his account by paying cash of Rs. 24,500</p>\n<p><strong>Required</strong>: Journal entries</p>', 9, 12, 19, 0, 1, 0, 0, 21, 94, 0, 0, 143, 1, '2016-05-15 15:15:30'),
(68, '12895', '9', 'Text Entry', '', 'practical', 'bs', '2073', '2+2', '<p>Following transactions are given:</p>\n<p>Shrawan 3&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; :&nbsp;&nbsp; Purchased goods worth Rs. 2,00,000 from sohan &amp; Co.</p>\n<p>Shrawan 4&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; :&nbsp;&nbsp; Returned goods worth Rs. 30,000 to Sohan &amp; Co.</p>\n<p>Shrawan 18&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; :&nbsp;&nbsp; Purchased goods worth Rs. 50,000 from Sohan &amp; Co.</p>\n<p>Shrawan 25&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; :&nbsp;&nbsp; Paid Rs. 1,65,000 to Sohan &amp; Co. for full settlement of Rs. 1,70,000</p>\n<p><strong>Required</strong>: (i) Journal entries (ii) Sohan &amp; Co. Account</p>', 9, 12, 19, 0, 1, 0, 0, 21, 94, 69, 0, 143, 1, '2016-05-15 15:15:30'),
(69, '39663', '9', 'Text Entry', 'A', 'practical', 'bs', '2069', '4', '<p>Following transactions are given:</p>\n<ol>\n<li>Purchased goods from Shipag centre Rs. 1,00,000</li>\n<li>Goods returenend to Shipag centre Rs. 10,000</li>\n<li>Further purchase of goods from Shipag centre fro Rs. 50,000</li>\n<li>Issuea a cheque of Rs. 1,35,000 to shipag centre for the full settlement of Rs. 1,40,000</li>\n</ol>\n<p><strong>Required</strong>: (a) Journal entries (b) Shipag centre account</p>', 9, 12, 19, 0, 1, 0, 0, 21, 94, 69, 0, 143, 1, '2016-05-15 15:15:30'),
(70, '69631', '9', 'Text Entry', 'B', 'practical', 'bs', '2069', '4', '<p>Following transactions are given:</p>\n<p>2068 Baishak 1 : Started business with cash Rs. 2,00,000</p>\n<p>2068 Baishak 2 : &nbsp;&nbsp; Deposited into Bank Rs. 1,00,000</p>\n<p>2068 Baishak 4 : Out of goods purchased from Bhola of Rs. 50,000, Rs. 30,000 is paid in cash and rest on credit.</p>\n<p>2068 Baishak 6 : Goods sold to Santa Rs. 25,000</p>\n<p>2068 Baishak 8 : Settlemed Bhola''s Account by issuing a cheque of Rs. 19,500</p>\n<p>2068 Baishak 9 : Santa settled his account and allowed him 2% discount</p>\n<p><strong>Required</strong>: Journal entries</p>', 9, 12, 19, 0, 1, 0, 0, 21, 94, 69, 0, 143, 1, '2016-05-15 15:15:30'),
(71, '50277', '9', 'Text Entry', '', 'practical', 'bs', '2068', '4', '<p>Following transactions are given:</p>\n<p>Baishak 4&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Goods sold to shyam Rs. 1,00,000</p>\n<p>Baishak 10&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Received goods returned by shyam Rs. 5,000</p>\n<p>Baishak 22&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Sold goods to Shyam Rs. 55,000</p>\n<p>Baishak 25&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Receievd a cheque of Rs. 94,000 from Shyam in full settlement of Rs. 95,000</p>\n<p>Required: (a) Journal entries (b) Shyam''s Account</p>', 9, 12, 19, 0, 1, 0, 0, 21, 94, 69, 0, 143, 1, '2016-05-15 15:15:30'),
(72, '41380', '9', 'Text Entry', '', 'practical', 'bs', '2067', '4', '<p>The following transactions are given:</p>\n<p>2066 Chaitra 1 &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Started business with cash Rs. 2,00,000</p>\n<p>Chaitra 2 &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Cash deposited into Bank Rs. 1,00,000</p>\n<p>Chaitra 5&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Purchased goods on credit from Ganesh Rs. 50,000</p>\n<p>Chaitra 10&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Settled Ganesh''s account by paying cheque of Rs. 49,000</p>\n<p><strong>Required</strong>: (i) Journal entries (ii) Ganesh''s Account</p>', 9, 12, 19, 0, 1, 0, 0, 21, 94, 69, 0, 143, 1, '2016-05-15 15:15:30'),
(73, '54957', '9', 'Text Entry', '', 'practical', 'bs', '2073', '2+1', '<p>Following transactions are given:</p>\n<p>(i)&nbsp;&nbsp;&nbsp; Shyam started business with cash Rs.2,00,000 &amp; Furniture of Rs.25,000</p>\n<p>(ii)&nbsp;&nbsp; Purchased goods from Ram of Rs.40,000</p>\n<p>(iii)&nbsp; Sold goods to Shiva of Rs.5,000</p>\n<p>(iv)&nbsp; Settled Ram''s account receiving discount at 10%</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>Required:</strong> (i) Journal Entries (ii) Ram''s Account</p>', 9, 12, 19, 0, 1, 0, 0, 21, 94, 69, 0, 143, 1, '2016-05-15 15:15:30'),
(74, '60649', '9', 'Text Entry', '', 'practical', 'bs', '2069', '2+1', '<p>The following transactions are given:</p>\n<p>Baisakh 3:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Purchased goods worth Rs.75,000 cash</p>\n<p>Baisakh 5:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Purchased goods worth Rs.1,00,000 from Shyam on credit.</p>\n<p>Baisakh 8:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Purchased furniture worth Rs.25,000, paid through cheque.</p>\n<p>Baisakh 18:&nbsp;&nbsp;&nbsp; Sold goods worth Rs.40,000 cash</p>\n<p><strong>Required:</strong> Journal entries</p>', 9, 12, 19, 0, 1, 0, 0, 21, 94, 69, 0, 143, 1, '2016-05-15 15:15:30'),
(75, '48373', '10', 'Text Entry', 'C', '', 'bs', '2073', '', '<p>Following purchase related transactions are given:</p>\n<p>2069 Magh 10&nbsp;&nbsp;&nbsp; : Purchased from Nepal Staionery</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - 20 dozen of pencils @ Rs. 10 per pencil</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; -5 dozens of pen @ Rs. 50 per pen</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (10% discount on pen olnly</p>\n<p>2069 Magh 20&nbsp;&nbsp;&nbsp; : 100 dozens exercise book @ Rs. 200 per dozen on cash</p>\n<p><strong>Required</strong>: Purchase book</p>', 9, 12, 19, 0, 1, 0, 0, 21, 94, 70, 0, 143, 1, '2016-05-15 15:15:30'),
(76, '58807', '10', 'Text Entry', '', 'practical', '', '2006', '', '<p>Following transactions are given:</p>\n<p>Falgun 1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : &nbsp;&nbsp;&nbsp; Credit purchased from shrestha</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 50 meter carpet @ Rs. 150 per meter.</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 25 pound raw woll @ Rs. 50 per pound</p>\n<p>Falgun 10&nbsp;&nbsp;&nbsp;&nbsp; : &nbsp;&nbsp;&nbsp; Credit purchased from Malla</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 80 meter jute carpet @ Rs. 100 per meter</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 200 pound raw jute @ Rs. 30 per pound</p>\n<p>Falgun 15&nbsp;&nbsp;&nbsp;&nbsp; : &nbsp;&nbsp;&nbsp; 100 Pound fine jute was purchased from Oil for cash @ Rs. 50 per pound.</p>\n<p><strong>Required</strong>: Purchase book</p>', 9, 12, 19, 0, 1, 0, 0, 21, 94, 70, 0, 143, 1, '2016-05-15 15:15:30'),
