(79, '28157', '10', 'Text Entry', 'B', 'practical', 'bs', '2069', '', '<p>Following are the transactions relating to purchases:</p>\n<p>Ashadh 2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Credit purchase from Mahes</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 20 VCD @ Rs. 300 per unit (10% trade discount)</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 30 DVD @ Rs. 500 per unit (without discount)</p>\n<p>Ashadh 20:&nbsp;&nbsp; Credit pruchase from Pashupati:</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 100 units Audio CD @ Rs. 200 per unit</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 100 Units Audio casettes @ Rs. 50 per unit</p>\n<p><strong>Required</strong>:&nbsp;&nbsp;&nbsp;&nbsp; (a) Purchase book (b) Purchase account</p>', 9, 12, 19, 0, 1, 0, 0, 21, 94, 70, 25, 143, 1, '2016-05-15 15:15:30'),
