INSERT INTO `hya_news` (`id`, `heading`, `slug`, `content`, `home_image`, `date`, `status`, `order`) VALUES
(2, 'New Manufacturing Trainers Available for Hire!', 'new_manufacturing_trainers_available_for_hire!', '                                    <p>\n	The Employee Trainers welcome three new VET trainers and assessors to our team. They bring with them over 35 years of industry experience and training expertise. They have trained in many facets of manufacturing including competitive systems and mainstream manufacturing process.</p>\n                                ', '1464444340_no_image.png', '2014-10-21 00:00:00', 'Publish', 3),
(4, 'Need Business Trainers?', 'need_business_trainers', '                                    <p>\n	Our business trainers are industry leaders and offer many years of experience. Students often feel our trainers level of knowledge not only equips them to better face the challenges of business and management but also motivates them to achieve success at work.</p>\n                                ', '1464444317_no_image.png', '2014-08-21 00:00:00', 'Publish', 1),
