INSERT INTO `hya_static_pages` (`page_id`, `link`, `page_type`, `page_name`, `display_type`, `page_title`, `page_slug`, `html_title`, `html_keyword`, `html_describe`, `content`, `price`, `youtube_link`, `video_id`, `content_below`, `description`, `home_image`, `order`, `date`, `status`) VALUES
(97, '', 'content', '', 'home||header||container', 'Home', 'home', 'home', 'home', 'home', '<div class="col-sm-12">\r\n	<div class="heading">\r\n		<h1>\r\n			SmartSikshya Experience</h1>\r\n	</div>\r\n	<p class="lead">\r\n		Experience something smart with SmartSikshya</p>\r\n</div>\r\n<p>\r\n	&nbsp;</p>\r\n', 0, '', '', '', '', '', 1, '0000-00-00', 'Publish'),
(113, '', 'subcontent', 'home', 'home||container', 'Book Shelf on your own digital device', 'book_shelf_on_your_own_digital_device', 'Book Shelf on your own digital device', 'Book Shelf on your own digital device', 'Book Shelf on your own digital device', '<p>\r\n	no necessity of collecting many books and adjusting your book shelf time and again. Just few clicks and you can customize the book shelf in your own digital device.</p>\r\n<p>\r\n	<i>We create an environment for you to create&hellip;</i></p>\r\n', 0, '', '', '', '', '', 0, '0000-00-00', 'Publish'),
(114, '', 'subcontent', 'home', 'home||container', 'Your Own learning Class', 'your_own_learning_class', 'Your Own learning Class', 'Your Own learning Class', 'Your Own learning Class', '<p>\r\n	SmartSikshya reaches to you, even at places where learning materials are not easily accessible and where the time of reach is very long.</p>\r\n<p>\r\n	<i>We believe learning should never be confined within the boundary&hellip;</i></p>\r\n', 0, '', '', '', '', '', 0, '0000-00-00', 'Publish'),
(115, '', 'subcontent', 'home', 'home||container', 'Eco Friendly Learning', 'eco_friendly_learning', 'Eco Friendly Learning', 'Eco Friendly Learning', 'Eco Friendly Learning', '<p>\r\n	Did you know, worldwide, paper accounts for 42% of the trees cut down by industry and roughly 40 million acres of forests continue to disappear each year. Imagine the positive impact it can create in the environment by taking the step to go digital.</p>\r\n<p>\r\n	<i>We believe in going green by opting to digital medium&hellip;</i></p>\r\n', 0, '', '', '', '', '', 0, '0000-00-00', 'Publish'),
(116, '', 'subcontent', 'home', 'home||container', 'Interactive caf with S-caf', 'interactive_cafe_with_s-cafe', 'Interactive caf with S-caf', 'Interactive caf with S-caf', 'Interactive caf with S-caf', '<p>\r\n	Experience a different caf&eacute; experience while you learn. Whenever you encounter a problem while learning and seek to know the solution or like to share your views, visit this interactive S-caf&eacute; and expand your knowledge with your fellow Smartyans.</p>\r\n<p>\r\n	<i>We provide platform for you to grow your educational network&hellip;</i></p>\r\n', 0, '', '', '', '', '', 0, '0000-00-00', 'Publish'),
(117, '', 'subcontentvideo', 'home', 'home||container', 'Introduction about our program', 'introduction_about_our_program', 'Introduction about our program', 'Introduction about our program', 'Introduction about our program', '                                    <p>\n	SmartSikshya is an online education portal offering education materials from SLC to Masters Level.</p>\n<p class="lead">\n	A platform where learning goes Smart</p>\n<p>\n	Education material includes updated past questions, practice sets, model questions and online quizzes of different level.</p>\n                                ', 0, 'https://www.youtube.com/embed/UWmiPH05ZTM', 'www.youtube.com', '', '', '', 0, '0000-00-00', 'Publish'),
(118, '', 'content', '0', 'header||container||footer', 'Know us', 'know_us', 'djf', 'dkjfn', 'sdkfn', '', 0, '', '', '', '', '', 3, '0000-00-00', 'Publish'),
(119, '', 'subpage', 'know_us', 'header||container', 'About company', 'about_company', '', '', '', '', 0, '', '', '', '', '', 1, '0000-00-00', 'Publish');
